// Oleksii Kovalenko telegram - @traewe

import React from "react";
import { ViewStyle } from "react-native";
import { Svg, Rect, Defs, Pattern, Use, Image } from "react-native-svg";

interface MicrophoneIconProps {
  style?: ViewStyle;
}

const MicrophoneIcon: React.FC<MicrophoneIconProps> = (props) => {
  return (
    <Svg style={props.style} viewBox="0 0 12 19" fill="none">
      <Rect y="0.799805" width="12" height="17.4" fill="url(#pattern0)" />
      <Defs>
        <Pattern
          id="pattern0"
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <Use
            href="#image0_763_11521"
            transform="matrix(0.00283203 0 0 0.00195312 -0.225 0)"
          />
        </Pattern>
        <Image
          id="image0_763_11521"
          width="512"
          height="512"
          href="data:image/png;base64,"
        />
      </Defs>
    </Svg>
  );
};

export default MicrophoneIcon;
